// @flow
import React from 'react';
import { Row, Col, Card, CardBody } from 'reactstrap';
import { Map, Marker, GoogleApiWrapper } from 'google-maps-react';

import PageTitle from '../../../components/PageTitle';

const BasicMap = props => {
    return (
        <Card>
            <CardBody>
                <h4 className="header-title mb-3">Basic Google Map</h4>

                <div className="gmaps">
                    <Map
                        google={props.google}
                        zoom={14}
                        initialCenter={{ lat: 37.5398126, lng: 127.0529696 }}
                        style={{ width: '100%', height: '100%', position: 'relative' }}></Map>
                </div>
            </CardBody>
        </Card>
    );
};
const MapWithMarker = props => {
    return (
        <Card>
            <CardBody>
                <h4 className="header-title mb-3">Google Map with Marker</h4>
                <div className="gmaps">
                    <Map
                        google={props.google}
                        zoom={18}
                        initialCenter={{ lat: 37.5398126, lng: 127.0529696 }}
                        style={{ width: '100%', height: '100%', position: 'relative' }}>
                        <Marker
                            title={'This is e-mart.'}
                            name={'e-mart'}
                            position={{ lat: 37.5398126, lng: 127.0529696 }}></Marker>
                    </Map>
                </div>
            </CardBody>
        </Card>
    );
};




const GoogleMaps = props => {
    const onEventChecker = (e, aug, geo) => {
    console.log(e);
    console.log(aug);
    console.log(geo);
  }
    return (
        <React.Fragment>
            <PageTitle
                breadCrumbItems={[
                    { label: 'Maps', path: '/features/googlemaps' },
                    { label: 'Google Maps', path: '/features/googlemaps', active: true },
                ]}
                title={'Google Maps'}
            />

            <Row>
                <Col lg={6}>
                    <MapWithMarker google={props.google} />
                </Col>
            </Row>
        </React.Fragment>
    );
};

export default GoogleApiWrapper({
    apiKey: 'AIzaSyC4edBh3bD-BNLfZK1LA1cKKzrt2p9aRBc',
})(GoogleMaps);
